	(66,'test001',1517579752,2,1517579808,0,1517579794,'https://wx.datazan.cn/tcm/data/Picture/2018-02-02/5a742a022bcf0.jpg',0.10,'81',1,1517579879,0,1,'209','','https://wx.datazan.cn/tcm/data/Picture/2018-02-02/5a742a022bcf0.jpg,https://wx.datazan.cn/tcm/data/Picture/2018-02-02/5a746dd25e46e.jpg','<img src=\"https://wx.datazan.cn/tcm/data/Editor/2018-02-02/5a746e0d90e78.jpg\" alt=\"\" />','',0),
	(67,'测试111',1517792916,-1,1517792932,0,1517793973,'https://wx.datazan.cn/tcm/data/Picture/2018-02-05/5a77ae369e0f3.jpg',0.01,'83',1,1517792926,0,1,'209','','https://wx.datazan.cn/tcm/data/Picture/2018-02-05/5a77ae4721ba3.jpg,https://wx.datazan.cn/tcm/data/Picture/2018-02-05/5a77ae4c4e225.jpg,https://wx.datazan.cn/tcm/data/Picture/2018-02-01/5a7272661bf66.jpg,https://wx.datazan.cn/tcm/data/Picture/2018-02-05/5a77ae369e0f3.jpg','<p class=\"MsoNormal\" style=\"margin:2.25pt;text-indent:0pt;padding:0pt;line-height:24pt;background:#FFFFFF;\">\n	<span style=\"font-family:宋体;\"><strong>项目介绍：</strong></span><br />\n<span style=\"font-family:宋体;\">中医推拿的作用是疏通经络，行气活血，滑利关节。推拿疗法的理论依据是以中医的脏腑经络学说为指导的。经络是人体内经脉和络脉的总称。是气血运行的通路，它们在人体内彼此紧密相连，纵横交错，内通五脏六腑、外络肢体皮毛，从而构成一个完整的循环系统，起着兴气血、通阴阳、养脏腑、利关节的作用。如果气血循经顺利运行。那么人自然身体健康，如果气血运行受阻，人就产生疾病。推拿疗法就是能够使经络畅通阴阳平衡，从而使人保持一个健康状态。</span> \n</p>\n<p class=\"MsoNormal\" style=\"margin:2.25pt;text-indent:0pt;padding:0pt;line-height:24pt;background:#FFFFFF;\">\n	<span style=\"font-family:宋体;\"><br />\n</span><span style=\"font-family:宋体;\"><strong>适应人群</strong></span><span style=\"font-family:宋体;\"><strong>：</strong></span><br />\n<span style=\"font-family:宋体;\">颈椎肌肉劳损，肩周炎、肩背疼痛，腰肌劳损，腰痛，四肢关节、肌肉伤痛，头痛，颈椎肌肉劳损等。</span><o:p></o:p>\n</p>','天辅安中医馆推拿项目一次',0),
	(68,'测试111',1517794243,2,1517794254,0,1517794460,'https://wx.datazan.cn/tcm/data/Picture/2018-02-05/5a77ae4c4e225.jpg',0.01,'80',1,1517794264,1,1,'211','','https://wx.datazan.cn/tcm/data/Picture/2018-02-05/5a77ae4c4e225.jpg','<p class=\"MsoNormal\" style=\"margin:2.25pt;text-indent:0pt;padding:0pt;line-height:24pt;background:#FFFFFF;\">\n	<span style=\"font-family:宋体;\">项目介绍：</span><br />\n<span style=\"font-family:宋体;\">中医推拿的作用是疏通经络，行气活血，滑利关节。推拿疗法的理论依据是以中医的脏腑经络学说为指导的。经络是人体内经脉和络脉的总称。是气血运行的通路，它们在人体内彼此紧密相连，纵横交错，内通五脏六腑、外络肢体皮毛，从而构成一个完整的循环系统，起着兴气血、通阴阳、养脏腑、利关节的作用。如果气血循经顺利运行。那么人自然身体健康，如果气血运行受阻，人就产生疾病。推拿疗法就是能够使经络畅通阴阳平衡，从而使人保持一个健康状态。</span><br />\n<span style=\"font-family:宋体;\">适应人群</span><span style=\"font-family:宋体;\">：</span><br />\n<span style=\"font-family:宋体;\">颈椎肌肉劳损，肩周炎、肩背疼痛，腰肌劳损，腰痛，四肢关节、肌肉伤痛，头痛，颈椎肌肉劳损等。</span><o:p></o:p>\n</p>','天辅安中医馆针灸',0),
